<head>
  <style>
    html,
    body {
      font-family: monospace;
      text-align: center;
      color: white;

      margin: 0 auto;
    }

    h1 {
      font-size: 5em;
      margin-bottom: 0px;
    }

    .footer {
      display: inline-block;
      font-size: 2em;
      margin-bottom: 32px;
    }

    .wedding-pic {
      max-width: 50%;
      display: block;
      margin-left: auto;
      margin-right: auto;
      border: 6px solid white;
      border-radius: 12px;
      animation: bouncing 3s;
      animation-iteration-count: infinite;
      animation-timing-function: cubic-bezier(.80, .32, .32, .80);
    }

    @keyframes bouncing {

      0%,
      100% {
        transform: translateY(0%);
      }

      50% {
        transform: translateY(5%);
      }
    }
